import './App.css';
import Footer from './components/footer';
import Header from './components/Header';
import HomeScreen from './screen/HomeScreen';

function App() {
  return (
    <>
    <Header />
     <main>
        <Container>
         <h1>Ecommerce-app</h1>
         <HomeScreen />
        </Container>
     </main>
      <Footer></Footer>
    </>
  );
}

export default App;
